import SliderItems from "./SliderItems";
import { dataPortfolio } from '../data/dataPortfolio';
import circle from '../assets/circle.png'; 

function PortfolioItem({id}) {
    return (
        <div className="modalPortal">
            <h2 className="headerDecorItem">{dataPortfolio[id].title}</h2>
            <div className="decorContainer">

            <div className="decorInfo">
                <h3 className="titleSlide">{dataPortfolio[id].header}</h3>
                <p className="text size position">{dataPortfolio[id].description}</p>
                <h3 className="titleSlide">{dataPortfolio[id].header2}</h3>
                {dataPortfolio[id].program.map((item,index) => {
                    return (
                        <div key={index}>
                            <div className="listItem">
                        <img src={circle} alt="circle" className="circle2"/><li className="text  size">{item}</li>
                        </div>
                        </div>
                    )
                })}
            </div>
            </div>
        </div>
    )
}

export default PortfolioItem;
